function NewComponentExpenses(props) {
  const title = props.expenses[(0, 1, 2, 3)].title;
  const amount = props.expenses[(0, 1, 2, 3)].amount;
  const date = props.expenses[(0, 1, 2, 3)].date;

  return (
    <div>
      <div>{title}</div>
      <div>{amount}</div>
      <div>{date}</div>
    </div>
  );
}

export default NewComponentExpenses;
